impl Solution {
    pub fn number_of_good_partitions(nums: Vec<i32>) -> i32 {
        let mod_val = 1_000_000_007;
        let n = nums.len();
        let mut last_pos = std::collections::HashMap::new();
        let mut dp = vec![0; n + 1];
        dp[0] = 1; // base case

        for i in 0..n {
            dp[i + 1] = dp[i];
            if let Some(&last) = last_pos.get(&nums[i]) {
                if last != 0 {
                    dp[i + 1] = (dp[i + 1] + dp[last - 1]) % mod_val;
                }
            } else {
                dp[i + 1] = (dp[i + 1] * 2) % mod_val;
            }
            last_pos.insert(nums[i], i + 1);
        }

        dp[n]
    }
}
